import React from 'react'
import axios from "axios";

function DeleteSubs({deleteId, closeDelete}) {
    console.log("##############", deleteId)

      // delete subscriber
  const deleteSub = async () => {
    axios
      .delete("/endpoint")
      .then((response) => {
        console.log("#############", response);
      })
      .catch((error) => {
        console.log("#############", error);
      });
  };
  return (
    <div>
        <div className='grid grid-cols-2 p-5'>
            <div>
            <button className="bg- md:w-40 w-full rounded-lg h-10 text-white" >
            YES
          </button>
            </div>
            <div>
            <button className="bg-blue-700 md:w-40 w-full rounded-lg h-10 text-white" onClick={closeDelete}>
            NO
          </button>
            </div>
        </div>
    </div>
  )
}

export default DeleteSubs
